import logo from './logo.svg';
import './App.css';
import { TimeSlider } from './components/TimeSlider';

function App() {
  return (
   <div><TimeSlider 
   min={6}
   max={24}
   defaultValue={6}
   label="one" 
   marks={[{value: 6, label: '6'}, {value: 12, label: '12'}, {value: 18, label: '18'}, {value: 24, label: '24'}]}/></div>
  );
}

export default App;
